import React, {useState} from 'react';
import './styles.css';

var ManagerAlbum = () => {
    return(
        <div>
            <h1>هذه الصفحهة تحت الإنشاء وسيتم إتاحتها في أقرب وقت ممكن</h1>
            <h2>إذا اردت اضافة اي صورة إلى الألبوم يمكنك التواصل مع مطور الموقع من خلال الواتساب وارسال الصورة والعنوان ليتم اضافتها</h2>
            <p>+966 56 342 3309</p>
        </div>
    );
}

export default ManagerAlbum;
